const useStyles = makeStyles({
    root: {
        height: 110,
        flexGrow: 1,
        maxWidth: 400,
    },
});



export const ApiDataShow = () => {

    const [practiceData, setpracticeData] = useState([] as any);
    const alldata:ApiData[]=[] as any;
    const [data, setData] = useState([] as any);
    useEffect(()=> {
        fetch('http://34.122.134.206:8080/api/viewall')
            .then(response => response.json())
            .then(json => setpracticeData(json)).catch(err=>console.log(err))
    }, []);

    const destructdata = (data_:any) => {
        const recusrionFunc=(data_:any,key:string,id:number,treeNodeData:ApiData):any=>{
            if(!Array.isArray(data_) || key==="frameDBUrl"){
                treeNodeData.id=`${key}-${id}`;
                treeNodeData.name=key+" : " +data_;
                treeNodeData.children=[];
                return treeNodeData;
            }

            data_.map((childItem:any)=>{
                Object.keys(childItem).map((childKey:string,childId:number)=>{
                    treeNodeData.id=`${key}-${id}`;
                    treeNodeData.name=key+" : ...";
                    treeNodeData.children=treeNodeData.children?[...treeNodeData.children,recusrionFunc(childItem[childKey],childKey,childId,{} as any)]:[recusrionFunc(childItem[childKey],childKey,childId,{} as any)];
                });
            });
            return treeNodeData;
        };
        data_.map((item:any,index:number)=>{
            const tempData:any=[];
            Object.keys(item).map((key:string,id:number)=>{
                const treeNodeData:ApiData={} as any;
                tempData.push(recusrionFunc(item[key],key,id,treeNodeData));
            });
            alldata.push({id:`Data-${index}`,name:`Data-${index}`,children:tempData})
        });
    };
    const renderTree = (nodes: any) => {
        const tree=Array.isArray(nodes)?
            nodes.map((item:ApiData)=>
                <TreeItem key={item.id} nodeId={item.id} label={item.name}>
                {Array.isArray(item.children) ? renderTree(item.children) : null}
            </TreeItem>):<TreeItem key={nodes.id} nodeId={nodes.id} label={nodes.name}/>;

        return tree;
    };
    const LoadApiData = () => {
        destructdata(practiceData);
        console.log(alldata);
        setData(alldata);
        console.log(data);

    }


    const classes = useStyles();
    return (
        <div>
            <button className="button"
                    onClick={LoadApiData}>
                Click to Get data
            </button>
            <p> Api Response: </p>
            <TreeView
                defaultCollapseIcon={<ExpandMoreIcon/>}
                defaultExpanded={['root']}
                defaultExpandIcon={<ChevronRightIcon/>}
                onNodeSelect={(e:any,value:any)=>{console.log(e,value)}}
            >
                {/*{destructdata(practiceData)}*/}
                {/*{renderTree([{id: "0", name: "UserluxandID : 44968", children: Array(0)},*/}
                {/*    {id: "1", name: "frameUrl : ...", children:[{id: "0", name: "imageUrl : http://storage.luxand.cloud/f9e0ff15edcd4f"}]}])}*/}
                {/*{data?renderTree(data):null}*/}
                {renderTree(data)}
            </TreeView>
        </div>

    )

}


